def flowFile = session.get()
if (!flowFile) return

def schema = flowFile.getAttribute('schema')

flowFile = session.write(flowFile, { inputStream, outputStream ->
    def createDatabase = "CREATE DATABASE IF NOT EXISTS ${schema}"
    outputStream.write(createDatabase.getBytes('UTF-8'))
} as org.apache.nifi.processor.io.StreamCallback)

session.transfer(flowFile, REL_SUCCESS)

import groovy.json.JsonSlurper
import org.apache.nifi.processor.io.InputStreamCallback
import java.nio.charset.StandardCharsets

def ff = session.get()
if(!ff) return

def schema = ff.getAttribute('schema') ?: 'default'
def table = ff.getAttribute('table') ?: 'new_table'

def json = null

session.read(ff, { inputStream ->
    json = new JsonSlurper().parse(inputStream)
} as InputStreamCallback)

if (!(json instanceof List)) {
    if (json instanceof Map) json = [json]
    else throw new RuntimeException("Invalid JSON")
}

// Mapping Postgres  ClickHouse (basic)
def typeMap = [
    'integer':'Int32',
    'bigint':'Int64',
    'smallint':'Int16',
    'text':'String',
    'varchar':'String',
    'character varying':'String',
    'boolean':'UInt8',
    'numeric':'Decimal(18,4)',
    'decimal':'Decimal(18,4)',
    'double precision':'Float64',
    'real':'Float32',
    'timestamp':'DateTime',
    'timestamp without time zone':'DateTime',
    'timestamp with time zone':'DateTime',
    'date':'Date',
    'json':'String',
    'jsonb':'String',
    'uuid':'UUID'
]

def colDefs = json.collect { col ->
    def name = col.column_name
    def pgType = (col.data_type ?: "text").toLowerCase()
    def chType = typeMap[pgType] ?: "String"

    // Nullable
    def nullable = (col.is_nullable ?: "").toString().toUpperCase()
    if (nullable == 'YES') chType = "Nullable(${chType})"

    // Drop Postgres default nextval()
    def defaultVal = ""
    if (col.column_default) {
        def d = col.column_default.toString()

        if (!(d =~ /nextval/)) {
            d = d.replaceAll(/(?i)CURRENT_TIMESTAMP/, 'now()')
            d = d.replaceAll(/::\w+/, '')  // remove ::regclass
            defaultVal = " DEFAULT ${d}"
        }
    }

    return "    ${name} ${chType}${defaultVal}"
}

def sql = """CREATE TABLE IF NOT EXISTS ${schema}.${table}
(
${colDefs.join(",\n")}
)
ENGINE = MergeTree()
ORDER BY tuple()"""

ff = session.putAttribute(ff, "create.table.sql", sql)

session.transfer(ff, REL_SUCCESS)
